import './Logo.css';
import ReturnButton from './Button';
import Media from 'react-media';

// view logo 
export default function Returnlogo() {
 return (
  <div>
   <Media
    query='(min-width: 599px)' render={() => (
     <div className='wrp-logo-home'>
      <img src={'/img/logo.png'} alt='logo Allience pour le changement' />
      <ReturnButton />
     </div>
    )}
   />
  </div>
 );
};
